import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function createNotes(noteItem)
{
    return <Note
    title = {noteItem.title}
    text = {noteItem.text}
    />;
}


function App()
{
    return( <div>
        <Header />
        {notes.map(createNotes)}
        <Footer />
    </div>
    );
}

export default App;
